    false,nt"url": null,nt"notes": "This narrative report for Crescent Lake
    National Wildlife Refuge outlines Refuge accomplishments from November through January
    of 1941. The report begins by summarizing the weather conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, mammals, and fish-
    is also covered. The Refuge development and maintenance section discusses physical
    developments. Resource management is outlined; topics include grazing. The public
    relations section of the report describes Refuge visitors and hunting. Photographs
    are attached. A short narrative report of North Platte National Wildlife Refuge
    is included.",nt"license_title": "License Not Specified",nt"extras":
